const styles = {
    image: {
        borderRadius: "20px",
        width: "350px",
        height: "200px"
    },
    button: {
        borderRadius: "20px",
        width: "150px",
        height: "45px",
    },
    button_container: {
        display: "flex",
        justifyContent: "left",
        marginTop: "45px",
    },
}

export default styles;
